clcclearbeta = [0.000975];eta = [0.0389];G_Na = [8];G_BK = [1.2];G_Ca = [4];beta = linspace(0, 0.002, 100);eta = linspace(0.02, 0.023, 100);% G_Na = linspace(0, 16, 10);% G_BK = linspace(0, 2.4, 10);% G_Ca = linspace(0, 12, 50);show_plot = false;surface = zeros(length(G_Na), length(G_BK));freq = zeros(1, length(eta) * length(beta) * length(G_Na) * length(G_BK) * length(G_Ca));if show_plot    figure(1)endticcounter = 1;for eta_i = 1:length(eta)    for beta_i = 1:length(beta)        for G_Na_i = 1:length(G_Na)            for G_BK_i = 1:length(G_BK)                for G_Ca_i = 1:length(G_Ca)                    [~,~,~,~,peaks] = imtiaz_2002d_noTstart_COR_exported(beta(beta_i), eta(eta_i), G_Na(G_Na_i), G_BK(G_BK_i), G_Ca(G_Ca_i), show_plot);                    freq(counter) = peaks;                    surface(eta_i,beta_i) = peaks;                    counter = counter + 1;                end            end        end    endendfprintf('Average time per iteration: %f s', toc/(length(eta) * length(beta) * length(G_Na) * length(G_BK) * length(G_Ca)));figure(2)% plot(beta_val, freq)% title('$\beta$ vs. Freq with $\eta$=0.0389 and $IP3$=0.4778', 'Interpreter', 'Latex')% xlabel('$\beta$', 'Interpreter', 'Latex')% ylabel('Freq. (cpm)')% plot(eta_val, freq)% title('$\eta$ vs. Freq with $\beta$=0.000975 and $IP3$=0.4778', 'Interpreter', 'Latex')% xlabel('$\eta$', 'Interpreter', 'Latex')% ylabel('Freq. (cpm)')% plot(G_Na, freq)% title('$G_{Na}$ vs. Frequency', 'Interpreter', 'Latex')% xlabel('$G_{Na}$', 'Interpreter', 'Latex')% ylabel('Freq. (cpm)')% plot(G_BK, freq)% title('$G_{BK}$ vs. Frequency', 'Interpreter', 'Latex')% xlabel('$G_{BK}$', 'Interpreter', 'Latex')% ylabel('Freq. (cpm)')% plot(G_Ca, freq)% title('$G_{Ca}$ vs. Frequency', 'Interpreter', 'Latex')% xlabel('$G_{Ca}$', 'Interpreter', 'Latex')% ylabel('Freq. (cpm)')mesh(beta, eta, surface);